window.bookSummaryJSON = "<p>Two women. An office filled with secrets. One terrible crime that can't be taken back.</p> <p>Dawn Schiff is strange.</p> <p>At least, everyone thinks so at Vixed, the nutritional supplement company where Dawn works as an accountant. She never says the right thing. She has no friends. And she is always at her desk at precisely 8:45 a.m. </p> <p>So when Dawn doesn't show up to the office one morning, her coworker Natalie Farrell―beautiful, popular, top sales rep five years running―is surprised. Then she receives an unsettling, anonymous phone call that changes everything…</p> <p>It turns out Dawn wasn't just an awkward outsider―she was being targeted by someone close. And now Natalie is irrevocably tied to Dawn as she finds herself caught in a twisted game of cat and mouse that leaves her wondering: who's the real victim? But one thing is incredibly clear: somebody hated Dawn Schiff.</p> <p>Enough to kill.</p> <p>The Coworker is a tense, captivating thriller from New York Times bestselling author Freida McFadden that explores the dark ways the past can echo through the present―with deadly consequences.</p>"; 
